import React from 'react';
import sdata from './Sdata';
import Card from './Cards';

function Netflix() {
    return (
        <Card
            key = {sdata[3].id} 
            imgsrc={sdata[3].imgsrc}
            title={sdata[3].title}
            sname={sdata[3].sname}
            link={sdata[3].link} 
        />
    );
}

export default Netflix;
